const Event = (props) =>
{
    console.log(props)

    return (
        <div>
            <p>Название: {props.name}</p>
            <p>Дата: {props.date}</p>
            <p>Время: {props.time}</p>
            <p>Описание: {props.descriPsion}</p>
            <p>Место: {props.place}</p>
        </div>
    )
}

export default Event;
